public class InnerVirtualGatewayVirtualGatewayClientTlsCertificateFactory(Action<Humidifier.AppMesh.VirtualGatewayTypes.VirtualGatewayClientTlsCertificate> factoryAction = null) : SubResourceFactory<Humidifier.AppMesh.VirtualGatewayTypes.VirtualGatewayClientTlsCertificate>
{

    internal InnerVirtualGatewayVirtualGatewayListenerTlsSdsCertificateFactory SDSFactory { get; set; }

    internal InnerVirtualGatewayVirtualGatewayListenerTlsFileCertificateFactory FileFactory { get; set; }

    protected override Humidifier.AppMesh.VirtualGatewayTypes.VirtualGatewayClientTlsCertificate Create()
    {
        var virtualGatewayClientTlsCertificateResult = CreateVirtualGatewayClientTlsCertificate();
        factoryAction?.Invoke(virtualGatewayClientTlsCertificateResult);

        return virtualGatewayClientTlsCertificateResult;
    }

    private Humidifier.AppMesh.VirtualGatewayTypes.VirtualGatewayClientTlsCertificate CreateVirtualGatewayClientTlsCertificate()
    {
        var virtualGatewayClientTlsCertificateResult = new Humidifier.AppMesh.VirtualGatewayTypes.VirtualGatewayClientTlsCertificate();

        return virtualGatewayClientTlsCertificateResult;
    }
    public override void CreateChildren(Humidifier.AppMesh.VirtualGatewayTypes.VirtualGatewayClientTlsCertificate result)
    {
        base.CreateChildren(result);

        result.SDS ??= SDSFactory?.Build();
        result.File ??= FileFactory?.Build();
    }

} // End Of Class

